INSERT INTO `md_tweets_article` VALUES ('1515727375204', '减少宝宝过敏/感染，我有话要说', 'http://blb-oss.oss-cn-hangzhou.aliyuncs.com/qjxk/image/tweet/articleImg/tu/001.jpg', '宝宝', '2cf47ec5fcd611e7a1a00a0027000004', '4', '3', '25', '<p><span style=\"color: rgb(102, 102, 102); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\">目前非传染性疾病已成为全球主要死亡原因，其中免疫相关性疾病，包括过敏、哮喘、自身免疫性疾病等发生率日益增长，已成为重要公共健康问题之一。</span><br/><br/><span style=\"color: rgb(102, 102, 102); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\">2017年世界过敏组织在罗马圆桌会议中指出，免疫适宜（Immune fitness，即一个有弹性的免疫系统，具有通过建立、维持和调节适当的免疫反应来适应各种挑战的内在能力）是预防非传染性疾病、过敏、哮喘的关键因素。</span><br/><br/><span style=\"color: rgb(102, 102, 102); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\">事实上，生命早期免疫系统的正常发育对于免疫适宜的形成至关重要，这也是为什么世界卫生组织提出早期生命干预/预防策略的重要原因。众所周知，母乳喂养可帮助新生儿抵抗感染，促进免疫发育，同时诱导免疫耐受以形成免疫适宜的状态。</span><br/><br/><span style=\"color: rgb(102, 102, 102); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\">研究发现，母乳中含有大量具有免疫特性的化合物，诸如抗微生物化合物、免疫发育化合物、益生元、益生菌等，尤其益生元和益生菌是最近研究的热点，那么其在母乳喂养过程中，对婴幼儿免疫适宜究竟发挥了什么样的作用呢？对于无法母乳喂养的婴幼儿，我们又该如何应对？添加益生元、益生菌的婴儿配方又有哪些益处？</span><br/><br/><span style=\"color: rgb(102, 102, 102); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\">欢迎说出您的真知灼见，参与话题讨论！</span></p>', '1', '0', '0', '2018-01-12 11:22:55', '', '2018-01-19 01:11:49', '1', '2018-02-28 17:44:24', null);
INSERT INTO `md_tweets_article` VALUES ('1515727375206', '测血糖不用针管了 科学家正研发可检测血糖的隐形眼镜', 'http://blb-oss.oss-cn-hangzhou.aliyuncs.com/qjxk/image/tweet/articleImg/tu/1500H2529540-161452.jpg', '糖尿病', '2cf47ec5fcd611e7a1a00a0027000004', '1', '3', '23', '<p><span style=\"font-size: 14px;\">科学家已经成功设计出了新型隐形眼镜，可以在不使用针管刺破皮肤的前提下测量佩戴者的血糖含量。目前，这款产品原型已经在兔子身上成功测试，但目前的不确定因素是眼泪能否精准测量血糖含量。如果这项技术真能应用于现实生活，那么对于糖尿病患者来说无疑是重大利好消息。</span><br/><br/><span style=\"font-size: 14px;\">据羿戓信息所了解，这些隐形眼镜采用了和目前市场上相同的透明、柔性材质，只不过研究人员在眼镜上嵌入了电子芯片，包括一个小型 LED 灯和一个葡萄糖传感器。今天发表在 Science Advances 杂志上的报告上称，一旦佩戴者的血糖含量超过某个限定值，那么隐形眼镜上的 LED 就会持续点亮闪烁，从而提醒佩戴者。</span><br/><br/><span style=\"font-size: 14px;\">该项目由韩国蔚山国立科学技术研究院的 Jang-Ung Park 带领，已经成功使用人造眼泪对这些眼镜进行了测试，在早期的模拟测试中成功在低葡萄糖含量的眼泪中测出了血糖含量，随后又在兔子身上成功测试。目前项目并未在人体或者人类眼泪上进行测试。</span></p>', '1', '0', '0', '2018-01-12 11:22:55', '', '2018-01-16 12:11:34', '1', '2018-02-28 17:44:50', null);
INSERT INTO `md_tweets_article` VALUES ('1515727933295', '全国首例，10万医生将被监控！', 'http://blb-oss.oss-cn-hangzhou.aliyuncs.com/qjxk/image/tweet/articleImg/tu/20170721013.jpg', '热搜', 'c37f4b49fcd711e7a1a00a0027000004', '5', '5', '61', '<p>▍来源：赛柏蓝&nbsp; 作者：禹鑫</p><p>全国第一次，一个省二级及以上医院的医生，将被监控！人数或超过10万。</p><p>&nbsp;</p><p>▍湖北设“天网”，监控423家医院</p><p>日前，据楚天都市报报道，湖北卫计委党组书记张晋，在接受采访时透露，从今年3月份起，湖北将在全省所有二级及以上医院，对医生开处</p><p>方过程进行动态监管。</p><p>&nbsp;</p><p>湖北卫计委资料库显示，今年将被监控的有302家二级医院和121家三级医院。根据国家统计局2015年发布的年度统计报告，全国有执业医师</p><p>和执业助理医师282万人；湖北作为全国医疗强省之一，以平均值估算此次涉及的医生，可能超过10万人。</p><p>这个系统如鹰眼，似“天网”，裸露医生秘密、照亮灰色地带。</p><p>&nbsp;</p><p>▍医生过度用药，最严处罚</p><p>监控系统，将全省二级及以上医院，所有开处方的电脑联网。</p><p>&nbsp;</p><p>如果医生过度检查、过度用药，不需要拍片的开拍片，不需要做B超的开B超等，监控系统会根据病情录入情况智能分析，自动弹窗提示医生科</p><p>学用药，如果医生一意孤行，系统将分析识别并上报。</p><p>&nbsp;</p><p>一旦医生存在过度医疗行为，轻则警告，重则处分，甚至吊销执照。张晋表示，这个系统将在2018年3月起在湖北省推广，年底之前，所有的二</p><p>级及以上医院都要覆盖。</p><p>&nbsp;</p><p>▍2018控费，敲击每位医药人</p><p>&nbsp;</p><p>坦率说，不合理的医疗费用增长，的确是该控制下了。我国药品浪费触目惊心，尽管缺乏权威数据统计，但2013年的一项网络调查显示，我国每</p><p>年家庭浪费的药品价值超过100亿元。</p><p>&nbsp;</p><p>如果再算上打了可用可不用的针剂，开了可查不可查的检查，医保被浪费的资金，肯定是天文数字；社会被挥霍的财富，惊心动魄。</p><p>&nbsp;</p><p>种种迹象表明，2018年控费的绳索越拉越紧了。2017年底出现大量医院停药、停耗材的现象，或许会有人判断这只是阶段性的突发状况，但几</p><p>日前，河南突然抛出48份辅助用药目录，就将这种推测完全击碎。</p><p>&nbsp;</p><p>▍一些人，将被驱逐出行业</p><p>&nbsp;</p><p>如果再结合湖北省全面监控医生处方的“天网”，可以得出这样一个清晰的结论——2018，控费是首要大事，如晨钟暮鼓警告每位医药人，并</p><p>浸入行业骨髓。</p><p>&nbsp;</p><p>最大的影响，是一些人生存不下去了。准确说，是这个行业野蛮发展时，蜂拥进来的淘金者。</p><p>&nbsp;</p><p>当政策紧缩，国家最高层多次要求医药代表回归本身价值时，过滤和筛选就开始了。实际上预计春节过后就会正式发布的药代备案制（正式版），</p><p>起的就是这个作用。</p><p><br/></p>', '1', '0', '0', '2018-01-12 11:32:52', '', '2018-01-19 12:11:51', '1', '2018-01-12 11:32:52', null);
INSERT INTO `md_tweets_article` VALUES ('1515727933299', '突发腹泻（有不洁食用西红柿汁史）', 'http://blb-oss.oss-cn-hangzhou.aliyuncs.com/qjxk/image/tweet/articleImg/tu/3-161123091434.jpg', '病例', 'c37f4b49fcd711e7a1a00a0027000004', '5', '3', '24', '<p><font color=\"#333333\" face=\"PingFang SC, Source Han Sans SC, Noto Sans CJK SC, Hiragino Sans GB, Microsoft YaHei UI, Microsoft YaHei, sans-serif\"><span style=\"font-size: 14px; background-color: rgb(255, 255, 255);\">病例：</span></font></p><p><span style=\"color: rgb(51, 51, 51); font-family: &quot;PingFang SC&quot;, &quot;Source Han Sans SC&quot;, &quot;Noto Sans CJK SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">患儿，男，2岁8个月，出生体重六斤，身长50厘米，评分正常。 两个月时突发腹泻（有不洁食用西红柿汁史），一日平均10次左右，大便稀，呈蛋花状，有黑褐色粘稠状团块，大便常规检查有白细胞和脓细胞，大便隐血......</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: &quot;PingFang SC&quot;, &quot;Source Han Sans SC&quot;, &quot;Noto Sans CJK SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><br/></span></p><p><span style=\"color: rgb(51, 51, 51); font-family: &quot;PingFang SC&quot;, &quot;Source Han Sans SC&quot;, &quot;Noto Sans CJK SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(51, 51, 51); font-family: &quot;PingFang SC&quot;, &quot;Source Han Sans SC&quot;, &quot;Noto Sans CJK SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, sans-serif; font-size: 14px; background-color: rgb(250, 250, 250);\">从病史上看此小儿的佝偻病要考虑是由腹泻所致，但不能排除抗vitD性佝偻病的可能，建议进行佝偻病的常规检查。关于腹泻的可能病因要重点考虑乳糖不耐性腹泻或小儿过敏性腹泻，建议进行大便乳糖含量的测定或消化道钡剂检查。可试用无乳糖性奶粉，同时加用微生态疗法</span></span></p><p><span style=\"color: rgb(51, 51, 51); font-family: &quot;PingFang SC&quot;, &quot;Source Han Sans SC&quot;, &quot;Noto Sans CJK SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(51, 51, 51); font-family: &quot;PingFang SC&quot;, &quot;Source Han Sans SC&quot;, &quot;Noto Sans CJK SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, sans-serif; font-size: 14px; background-color: rgb(250, 250, 250);\"><br/></span></span></p><p><span style=\"font-size: 14px;\">注射维生素D和服用钙尔奇至今,有可能会导致vitd 中毒，不知逆的佝偻病的诊断依据是什么？对维生素D敏感的患儿每天摄取维生素D4000IU，经1～3月后即可出现中毒症状。 维生素D中毒的可靠X线征是：①尺桡骨干皮南骨模糊并有骨膜反应。②皮质骨松化或骨质疏松。③尺桡骨干骺端梗化带或“疏密”琏。④骨干皮质增厚致密。⑤腕骨化骨核钙化环增厚硬化。以上5种X线征象中有同时出现3种征象，即可诊断为维生素D中毒，当然还必须结合临床病史及有VitD过量情况才能确诊。严重中毒者尚可见肾、血管、心脏及四肢软组织有转移性钙化。</span></p>', '1', '1', '1', '2018-01-12 11:32:52', '', '2018-01-18 11:11:43', '1', '2018-03-08 10:06:18', null);
INSERT INTO `md_tweets_article` VALUES ('151624467502324', '重回十年前，你还会从医么', 'http://blb-oss.oss-cn-hangzhou.aliyuncs.com/qjxk/image/tweet/articleImg/tu/46899baad4.jpg', '热搜', '2cf47ec5fcd611e7a1a00a0027000004', '1', '1', '31', '<p style=\"margin-top: 0px; margin-bottom: 15px; font-style: inherit; font-weight: inherit; white-space: normal; padding: 0px; font-size: 14px; word-wrap: break-word; border: 0px; vertical-align: baseline; line-height: 1.7 !important;\">最近一款游戏火爆朋友圈，没错，就是这只胖嘟嘟的青蛙……</p><p style=\"margin-top: 0px; margin-bottom: 15px; font-style: inherit; font-weight: inherit; white-space: normal; padding: 0px; font-size: 14px; word-wrap: break-word; border: 0px; vertical-align: baseline; line-height: 1.7 !important;\">很多人一夜之间变成了操心的老母亲，呱儿子出去旅行了就担心他为什么不回来，回来安安静静读书，又担心他为什么不出去旅行……</p><p style=\"margin-top: 0px; margin-bottom: 15px; font-style: inherit; font-weight: inherit; white-space: normal; padding: 0px; font-size: 14px; word-wrap: break-word; border: 0px; vertical-align: baseline; line-height: 1.7 !important;\">真真是操碎了心<img src=\"http://img.baidu.com/hi/face/i_f23.gif\"/>……</p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-size: 14px;\"><img src=\"http://blb-oss.oss-cn-hangzhou.aliyuncs.com/bibo-common/image/default/20180129/950038f7-367a-4455-a5e9-e6807b65cadf20180129.png\" title=\"950038f7-367a-4455-a5e9-e6807b65cadf20180129.png\" alt=\"3257270482567285392-8w.png\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; font-size: 14px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 15px; font-style: inherit; font-weight: inherit; white-space: normal; padding: 0px; font-size: 14px; word-wrap: break-word; border: 0px; vertical-align: baseline; line-height: 1.7 !important;\"><strong style=\"word-wrap: break-word;\">但，知道为什么你的蛙儿子老不出门？</strong></p><p style=\"margin-top: 0px; margin-bottom: 15px; font-style: inherit; font-weight: inherit; white-space: normal; padding: 0px; font-size: 14px; word-wrap: break-word; border: 0px; vertical-align: baseline; line-height: 1.7 !important;\"><strong style=\"word-wrap: break-word;\">消化科：怕是便秘了吧</strong></p><p style=\"margin-top: 0px; margin-bottom: 15px; font-style: inherit; font-weight: inherit; white-space: normal; padding: 0px; font-size: 14px; word-wrap: break-word; border: 0px; vertical-align: baseline; line-height: 1.7 !important;\"><strong style=\"word-wrap: break-word;\">呼吸科：怕是得了流感全身瘫软吧</strong></p><p style=\"margin-top: 0px; margin-bottom: 15px; font-style: inherit; font-weight: inherit; white-space: normal; padding: 0px; font-size: 14px; word-wrap: break-word; border: 0px; vertical-align: baseline; line-height: 1.7 !important;\"><strong style=\"word-wrap: break-word;\">内分泌科：怕是低钠淡漠了吧</strong></p><p style=\"margin-top: 0px; margin-bottom: 15px; font-style: inherit; font-weight: inherit; white-space: normal; padding: 0px; font-size: 14px; word-wrap: break-word; border: 0px; vertical-align: baseline; line-height: 1.7 !important;\"><strong style=\"word-wrap: break-word;\">妇产科：怕是...有了吧</strong></p><p style=\"margin-top: 0px; margin-bottom: 15px; font-style: inherit; font-weight: inherit; white-space: normal; padding: 0px; font-size: 14px; word-wrap: break-word; border: 0px; vertical-align: baseline; line-height: 1.7 !important;\"><strong style=\"word-wrap: break-word;\">……</strong></p><p style=\"margin-top: 0px; margin-bottom: 15px; font-style: inherit; font-weight: inherit; white-space: normal; padding: 0px; font-size: 14px; word-wrap: break-word; border: 0px; vertical-align: baseline; line-height: 1.7 !important;\"><img src=\"http://blb-oss.oss-cn-hangzhou.aliyuncs.com/bibo-common/image/default/20180129/d6671687-c69a-4a25-b41b-437c7b97af5620180129.png\" title=\"d6671687-c69a-4a25-b41b-437c7b97af5620180129.png\" alt=\"3257270482566963358-8w.png\"/></p><p style=\"margin-top: 0px; margin-bottom: 15px; font-style: inherit; font-weight: inherit; white-space: normal; padding: 0px; font-size: 14px; word-wrap: break-word; border: 0px; vertical-align: baseline; line-height: 1.7 !important;\"><strong style=\"word-wrap: break-word;\">园子里大家有养青蛙的吗？</strong></p><p style=\"margin-top: 0px; margin-bottom: 15px; font-style: inherit; font-weight: inherit; white-space: normal; padding: 0px; font-size: 14px; word-wrap: break-word; border: 0px; vertical-align: baseline; line-height: 1.7 !important;\"><strong style=\"word-wrap: break-word;\">来来，大家来发表你们的诊断吧～</strong></p><p style=\"white-space: normal;\"><strong style=\"word-wrap: break-word;\"><br/></strong></p><p><br/></p>', '1', '1', '1', '2018-01-18 11:04:35', '', '2018-01-19 11:11:46', '0', '2018-02-28 17:48:52', '0000-00-00 00:00:00');
