INSERT INTO `md_tweets_article` VALUES ('15162446750823', '一个特殊病例', 'http://blb-oss.oss-cn-hangzhou.aliyuncs.com/qjxk/image/tweet/articleImg/tu/95-1FP21I638.jpg', '病例', 'c37f4b49fcd711e7a1a00a0027000004', '19', '6', '80', '<p><span style=\"color: rgb(51, 51, 51); font-family: \">女，40岁，因门诊发现左眼“虹睫炎”一周，点典必殊、阿托品眼液效果不好，在门诊行地米结膜下注射；第二天复诊，前房炎症情况有好转，但出现颞下方角膜溃疡，2X2.5mm，浸及基质层，溃疡面干净清洁（状如玻......</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: \"></span></p><p><span style=\"color: rgb(51, 51, 51); font-family: \"></span></p>\r\n<video class=\"edui-upload-video  vjs-default-skin video-js\" controls=\"\" preload=\"none\" src=\"http://blb-oss.oss-cn-hangzhou.aliyuncs.com/bibo-common/image/default/20180129/5c73d139-6328-4b45-91f1-25cadfbfa76220180129.mp4\" data-setup=\"{}\"></video>', '1', '1', '1', '2018-01-18 11:04:35', '', '2018-01-19 12:11:54', '0', '2018-03-08 10:05:54', null);
