INSERT INTO `md_tweets_article` VALUES ('5161b70b575211e8ada17cd30ae458a2', '专题报道-绽妍的医学护肤品之路-福建泉州行', 'http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/public/ca02c44c-00fe-4966-a41b-f6ed760f469320180514.png', '', '5ab4bbedff2c11e7a1a00a0027000004', '0', '0', '14', '<p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp;</span><span style=\";font-family:宋体;font-size:16px\"><span style=\"font-family:宋体\">专题报道丨绽妍的医学护肤品之路</span>—福建泉州行</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp; &nbsp;<span style=\"font-family:宋体\">昨日，由福建医科大学附属第二医院主办的</span><span style=\"font-family:Calibri\">2017</span><span style=\"font-family:宋体\">国家级皮肤医疗新进展学习班于</span><span style=\"font-family:Calibri\">13</span><span style=\"font-family:宋体\">日</span><span style=\"font-family:Calibri\">17</span><span style=\"font-family:宋体\">时落下帷幕。会议为期两天，在泉州市鲤城大酒店举行召开</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><br/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><br/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">会议盛景</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><br/></p><p><span style=\";font-family:&#39;Times New Roman&#39;;font-size:14px\">&nbsp;<span style=\"font-family:宋体\">本次会议邀请了福建省内外皮肤医疗美容届的专家分享美容新进展，不仅有学术地位享誉全国的第四军医大学皮肤病医院的高天文教授、昆明医科大学第一附属医院云南省皮肤病医院何黎教授和江苏省人民医院的骆丹教授，也有本省皮肤理疗美容专家福建医科大学附属第二医院的郭燕妮、许天星教授</span>……<span style=\"font-family:宋体\">可以说，是福建省内外的专家学者们联手为我们带来的一场丰富的学术盛宴。</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/fb89884f-026f-4ad7-bcdb-128c57207a8d20180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 ;text-align:center\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">开幕式</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp; &nbsp; &nbsp;<span style=\"font-family:宋体\">作为此次会议的合作伙伴， 绽妍系列品牌自从</span><span style=\"font-family:Calibri\">2015</span><span style=\"font-family:宋体\">年上市以来就受到广大皮肤科医师的喜爱，尤其是在福建地区，更是成为皮肤科临床上的好帮手。此次会议，各位专家学者也分享了绽妍的临床应用。</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/0daafb76-ecff-4826-8113-cd649ba2c2eb20180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/7451ddd0-793e-46c5-bba7-bbffaf51b61120180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 ;text-align:center\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">骆丹教授分享绽妍系列在纳晶术后修复屏障的应用</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/7c6b6f6a-d5b8-472e-90f6-284a1fab6d5d20180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 ;text-align:center\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">许天星教授分享绽妍系列在治疗玫瑰痤疮中的应用</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/8249c38f-e664-45db-9751-33e8935b8c1820180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/b90ec01c-bf9a-4064-9bc2-4ffc30ae6db520180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/7e1ad9de-0044-4f82-b0c8-b112749dff4f20180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/71672bff-52fe-4bbc-866a-2bfd49c7766020180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/ea4d518a-1c06-418b-bf77-eb3ddcfea54f20180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">郭燕妮教授分享绽妍系列在特应性皮炎、痤疮中的应用</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/7ee0afe0-928a-40c6-86d0-37e034c64b1f20180514.png\" title=\"\" alt=\"\"/></p><p><span style=\";font-family:&#39;Times New Roman&#39;;font-size:14px\">&nbsp;<span style=\"font-family:宋体\">绽妍透明质酸修护系列，全套五个剂型均属于国家二类医疗器械，在临床上已经应用的非常成熟，收获诸多好评。后续上新的两个系列控油清痘系列、舒缓修红系列也在此次会议上受到各位皮肤美容届大咖们的关注。</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/27914c3e-af57-4438-8f2a-cce051d09fc920180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">郭教授分享绽妍舒缓修红系列的应用</span></span></p><p><span style=\";font-family:Calibri;font-size:14px\">&nbsp; &nbsp; &nbsp;<span style=\"font-family:宋体\">在</span><span style=\"font-family:Calibri\">8</span><span style=\"font-family:宋体\">月</span><span style=\"font-family:Calibri\">12</span><span style=\"font-family:宋体\">日下午召开的绽妍</span><span style=\"font-family:Calibri\">®</span><span style=\"font-family:宋体\">医学护肤品卫星会中，郭燕妮教授除了分享了绽妍现有产品在临床上的应用，也对绽妍后续新品计划发表了预告。</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/7f624608-7c56-4a31-8ed0-fc39ec0cf90520180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">绽妍新品：活肤亮颜、肌底紧致和果酸系列将会陆续上市</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;<span style=\"font-family:宋体\">白天的课程紧凑有趣，医疗美容皮肤科学者们的就一个个课题开展了精彩纷呈的演讲和讨论。</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/cd4400ed-150c-43ec-b318-9064fd1df71720180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/04792e6e-c083-4f29-b54a-68750635a96220180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/c0612eb7-3957-4197-9a4a-c235d32c7e1c20180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/5c36463b-ddc2-4c8d-b7c9-c25cb5ff1ae220180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 ;text-align:center\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">皮肤医美大咖分享自己的临床经验</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp; &nbsp; &nbsp;12<span style=\"font-family:宋体\">日晚上</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">绽放美丽、靓妍永驻</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">主题晚宴，一扫白天的紧张氛围，轻松有趣。特别设置的抽奖游戏环节也为大家此次的学习之旅增加了一分色彩。</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/a3f2a937-4bc6-4ff8-b94e-cad8720c033420180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/70fb121c-7458-4ed5-977e-9848f6f8f9ce20180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/38868ee2-a87c-4501-b75a-6b68d4ba7a1720180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/1d490fd7-d8fc-416a-9c3a-a87952d7889920180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&lt;&lt; &nbsp;<span style=\"font-family:宋体\">滑动查看晚宴精彩瞬间</span><span style=\"font-family:Calibri\">&gt;&gt;</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">晚宴后各位专家教授亲切的合影留念</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/8b7871db-5ca8-4ecd-be65-f30247e9ec0a20180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">左二为广东省皮肤病医院何仁亮教授、左四为福建医科大学附属第二医院郭燕妮教授、右四为江苏省人民医院骆丹教授、右三为福建医科大学附属第二医院许天星教授、右二为泉州市第一医院庄永灿教授，右一为绽妍品牌负责人王昆总经理。</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp; &nbsp; &nbsp; <span style=\"font-family:宋体\">国产医学护肤品之路非常难走，尤其是在这个品牌花样百出、品质参差不齐的时代，但是绽妍品牌一直秉承自己的初心，就像绽妍负责人亿帆医药器械事业部总经理王昆在晚宴开始时说道：绽妍坚持走，</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">再生医学科技，引领科学护肤</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">的路线，誓要为人类美丽事业不断的努力。</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp; &nbsp; &nbsp;<span style=\"font-family:宋体\">医学护肤路漫漫，但是我们也相信功夫不负有心人，注重品质，得到诸多皮肤科学家支持的绽妍也一定会越走越好！</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp; &nbsp; &nbsp;<span style=\"font-family:宋体\">美丽八月，绽妍也一直在路上！</span></span></p><p><br/></p><p><br/></p>', '1', '0', '0', '2018-05-14 16:39:30', '5ab4bbedff2c11e7a1a00a0027000004', '2018-05-14 17:56:04', '5ab4bbedff2c11e7a1a00a0027000004', '2018-05-14 17:55:28', '5ab4bbedff2c11e7a1a00a0027000004');
