-repeat:repeat; background-position:0% 0%; height:500px; }</style> </head><body ><p>test</p></body></html>', '0', '0', '0', '2018-02-28 14:56:08', '5ab4bbedff2c11e7a1a00a0027000004', null, null, null, null);
INSERT INTO `md_tweets_article` VALUES ('a1dad620211311e8ada17cd30ae458a2', 'aaa', 'http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/public/6831ba4b-cf28-4fd3-b290-24739d42001320180306.png', '测试,aaaa', '5ab4bbedff2c11e7a1a00a0027000004', '0', '0', '0', '<p>dsfdsfdsfsdfsd<br/></p>', '0', '0', '0', '2018-03-06 15:54:46', '5ab4bbedff2c11e7a1a00a0027000004', null, null, null, null);
INSERT INTO `md_tweets_article` VALUES ('b51a5d8e575011e8ada17cd30ae458a2', '绽妍与皮肤科精英相聚祖国各地-见证皮肤科诊疗技术新进展', 'http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/public/e3306387-7e78-462f-bb81-c77cb1fb2dc920180514.png', '热搜', '5ab4bbedff2c11e7a1a00a0027000004', '1', '1', '8', '<p style=\"margin-top:0;margin-right:3px;margin-bottom:0;margin-left:3px;padding:0 0 0 0 \"><span style=\";font-family:宋体;font-size:16px\"><span style=\"font-family:宋体\">绽妍与皮肤科精英相聚祖国各地，见证皮肤科诊疗技术新进展</span></span></p><p style=\"margin-top:0;margin-right:3px;margin-bottom:0;margin-left:3px;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">前言</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:11px\">&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">11<span style=\"font-family:宋体\">月</span><span style=\"font-family:Calibri\">18—19</span><span style=\"font-family:宋体\">日，由中华医学会皮肤性病分会主办、广西医学会 皮肤性病学分会承办的中华医学会皮肤性病学分会</span><span style=\"font-family:Calibri\">2017</span><span style=\"font-family:宋体\">年高级讲师团基层行在广西南宁如期举行。</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;<span style=\"font-family:宋体\">此次会议，在广西医院会皮肤性病学分会主任委员 广西医科大学第一附属医院 皮肤性病科主任林有坤教授的牵头组织下特别邀请到了中华医学会皮肤性病学分会侯任主委 中南大学湘雅二医院皮肤性病科主任陆前进教授以及中国医师学会皮肤科 皮肤科医师分会名誉会长 北京大学第一医院李若瑜教授等广西区内外著名专家学者分享了常见皮肤病诊疗的新进展，吸引了近</span><span style=\"font-family:Calibri\">400</span><span style=\"font-family:宋体\">位皮肤科精英汇聚一堂，共同学习分享皮肤科诊疗临床经验。</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/07e0b1d7-145d-45d2-bdc9-e690a7e4e96c20180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 ;text-align:center\"><span style=\";font-family:Calibri;font-size:16px\">11<span style=\"font-family:宋体\">月</span><span style=\"font-family:Calibri\">18</span><span style=\"font-family:宋体\">日晚大会开幕式正式在广西南宁召开</span></span></p><p style=\"margin: 0px; padding: 0px;\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\"><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/9424d546-c746-4aa1-bbcc-db6d89e41f8c20180514.png\" title=\"\" alt=\"\"/></span></span></p><p style=\"margin: 0px; padding: 0px;\"></p><p><strong><span style=\"font-family: &#39;Times New Roman&#39;\"><span style=\"font-family:宋体\">大会图集</span></span></strong></p><p style=\"margin: 0px; padding: 0px;\"><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/ff254c7d-285f-4fca-a2ca-5b5d6e8d6ebb20180514.png\" title=\"\" alt=\"\"/><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\"></span></span><br/></p><p style=\"margin: 0px; padding: 0px;\"><br/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/e5859391-039e-4986-a19c-52e8156a4cfe20180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/6867d209-ed2f-4502-841c-d419421a382e20180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 ;text-align:center\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">各位皮肤科专家学者分享诊疗经验的精彩瞬间</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp; &nbsp;<span style=\"font-family:宋体\">一直致力于推动皮肤科医学发展的医学护肤品牌绽妍此次也不负众望出现在会场上，除了展示绽妍家族新成员的同时，也邀请到了中日友好医院皮肤病与性病科主任崔勇教授分享绽妍透明质酸修护系列在以往临床中应用，收获无数好评，前来展位咨询和领取试用装的医师络绎不绝。</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\"><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/bf77e6e3-2f2c-4ee2-b9df-97268f6c037f20180514.png\" title=\"\" alt=\"\"/></span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 ;text-align:center\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">崔勇教授分享绽妍系列在皮肤科的应用</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">分享的精彩内容</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/813b4cef-f5c1-4150-a6d3-d9bf79cc877220180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/b64a4352-346a-4f10-9570-e4d4548d648720180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/d449a7e4-03bc-4de4-8acc-6ad2f418013020180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">此次崔勇教授的讲解非常细致，从绽妍的研发团队、技术支持、绽妍独特的复配透明质酸核心成分再到绽妍的临床应用，无不一一讲解，引人入胜。崔勇教授从事皮肤病和性病学科医疗、教育、科研工作</span>19<span style=\"font-family:宋体\">年，有非常丰富的从业经验，除此之外在皮肤影像学领域也有独到的见解，此次会议，作为</span><span style=\"font-family:Calibri\">CSID</span><span style=\"font-family:宋体\">（皮肤影像学院）组组长，崔教授也分享了皮肤影像技术在皮肤科的新进展。</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/b71b08df-f8b3-4997-835d-4a718cb069be20180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/5bc89165-23cb-480f-bc03-26b02b8a91c320180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/c5857c10-fd5b-48c2-a862-086e53c2c93b20180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/4dfc6431-21ea-435d-be44-9368525facda20180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&lt;&lt; &nbsp;<span style=\"font-family:宋体\">滑动查看下一张精彩瞬间 </span><span style=\"font-family:Calibri\">&nbsp;&gt;&gt;</span></span></p><p><img width=\"640\" height=\"13\" src=\"/plugins/ueditor-utf8-jsp/themes/default/images/spacer.gif\"/><span style=\";font-family:Calibri;font-size:14px\">&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp; &nbsp; &nbsp;<span style=\"font-family:宋体\">刚刚过去的周末对皮肤科医师来说绝对是一个不平凡的周末，在广西会议举行的同时，在云南昆明、山西晋中，皮肤科的盛事也在如火如荼的举行着。</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: &#39;Times New Roman&#39;\">11<span style=\"font-family:宋体\">月</span><span style=\"font-family:Times New Roman\">18</span><span style=\"font-family:宋体\">日</span></span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">云南省医学会烧伤整形外科学分会</span>2017<span style=\"font-family:宋体\">年学术年会</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/dfc91ec4-4360-4bef-8cf8-48793ac16b9320180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/50742748-27a0-42d1-aeab-33a2d46d745720180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">昆明医科大学附属第二医院整形外科主任王继华教授分享了绽妍在烧伤科、整形外科的临床应用</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/b2b51cf6-664f-4aa9-bff2-64f689266f8e20180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: &#39;Times New Roman&#39;\">11<span style=\"font-family:宋体\">月</span><span style=\"font-family:Times New Roman\">18</span><span style=\"font-family:宋体\">日</span></span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">山西晋中市医学会皮肤性病专业委员</span>2017<span style=\"font-family:宋体\">学术交流会</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/b0c5172f-4b10-4a68-a846-3730c05a922c20180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 ;text-align:center\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">前来绽妍展位排队领取礼品的医师络绎不绝</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp; &nbsp; &nbsp; </span><span style=\";font-family:Calibri;font-size:14px\"><span style=\"font-family:宋体\">就像昆明医科大学附属第二医院的王继华教授在会上说道，皮肤科的建设非一朝一夕之功，是无数皮肤科医师无数个日夜辛勤耕耘的结果。同样，绽妍医学护肤品品牌的建设也并非一两个会议就能见成效，致力于产品品质的优化、研发力量的提升、学术活动的开展和医学护肤品概念的普及才是我们绽妍团队不断要走的路。</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:14px\">&nbsp; &nbsp; &nbsp; <span style=\"font-family:宋体\">最后，附上</span><span style=\"font-family:Calibri\">12</span><span style=\"font-family:宋体\">月绽妍会议的邀请函。勿忘初心，我们一直在路上。</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">邀请函</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp; &nbsp; &nbsp; <span style=\"font-family:宋体\">届时绽妍家族新成员将会系数亮相，还会有精美礼品相赠，敬请期待！</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: Calibri;font-size: 16px\"><span style=\"font-family:宋体\">绽妍展位：</span>B26</span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: Calibri;font-size: 16px\"><span style=\"font-family:宋体\">深圳会展中心</span></span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: &#39;Times New Roman&#39;\">2017.12.15—17</span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 ;text-align:center\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">美丽鹏城，我们不见不散！</span></span></p><p><br/></p>', '1', '0', '0', '2018-05-14 16:27:58', '5ab4bbedff2c11e7a1a00a0027000004', '2018-05-14 16:28:09', '5ab4bbedff2c11e7a1a00a0027000004', null, null);
