INSERT INTO `md_tweets_article` VALUES ('f9f2eef8574811e8ada17cd30ae458a2', '绽妍与广西医学会皮肤性病学分会携手相约梧州', 'http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/public/65bfc33e-58d0-42dc-8b6f-8b5761dafaf920180514.png', '热搜', '5ab4bbedff2c11e7a1a00a0027000004', '0', '0', '4', '<p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:宋体;font-size:16px\"><span style=\"font-family:宋体\">灿烂七月，绽妍与广西医学会皮肤性病学分会携手相约梧州，留下辉煌！</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">会议盛宴</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/996ec462-8c5c-436e-ad60-7533bdbf9dd320180514.png\" title=\"\" alt=\"\"/></p><p><span style=\";font-family:&#39;Times New Roman&#39;;font-size:14px\">2017<span style=\"font-family:宋体\">年</span><span style=\"font-family:Times New Roman\">7</span><span style=\"font-family:宋体\">月</span><span style=\"font-family:Times New Roman\">15</span><span style=\"font-family:宋体\">日上午</span><span style=\"font-family:Times New Roman\">10</span><span style=\"font-family:宋体\">点，由广西医学会举办的</span><span style=\"font-family:Times New Roman\">2017</span><span style=\"font-family:宋体\">年广西医学会皮肤性病学分会学术年会暨性病艾滋病防治技术提高班在广西梧州江滨国际大酒店召开。参加本次会议的有享誉全国皮肤学界的著名专家上海瑞金医院郑捷教授、西京医院王刚教授、中国医科大学院皮肤病医院孙建方教授等出席本次学术会议并且针对皮肤性病临床诊断、治疗领域等相关问题进行特别演讲。本次会议吸引大约</span><span style=\"font-family:Times New Roman\">500</span><span style=\"font-family:宋体\">多名来自全国各地皮肤科医师到会参观。</span></span></p><p><span style=\";font-family:&#39;Times New Roman&#39;;font-size:14px\"><span style=\"font-family:宋体\"><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/e414919d-b5db-4451-9acd-71aa559ff8ca20180514.png\" title=\"\" alt=\"\"/></span></span></p><p><span style=\";font-family:&#39;Times New Roman&#39;;font-size:14px\"><span style=\"font-family:宋体\"><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/dd2615dc-a36e-4785-a25f-350c662530d620180514.png\" title=\"\" alt=\"\"/></span></span></p><p><span style=\";font-family:&#39;Times New Roman&#39;;font-size:14px\"><span style=\"font-family:宋体\"><br/></span></span></p><p><span style=\";font-family:&#39;Times New Roman&#39;;font-size:14px\"><span style=\"font-family:宋体\"></span></span></p><p><span style=\";font-family:&#39;Times New Roman&#39;;font-size:14px\"><span style=\"font-family:宋体\">作为此次大会的参展商之一，亿帆医药携旗下器械品牌绽妍</span>®<span style=\"font-family:宋体\">在会场设置了展位，展示了全绽妍</span><span style=\"font-family:Times New Roman\">®</span><span style=\"font-family:宋体\">系列品牌，绽妍透明质酸修护系列、</span><span style=\"font-family:Times New Roman\">JUYOU®</span><span style=\"font-family:宋体\">控油清痘系列和</span><span style=\"font-family:Times New Roman\">JUYOU®</span><span style=\"font-family:宋体\">舒缓修红系列。会议期间，绽妍展位人头攒动，前来领取试用装的人络绎不绝。</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/7b83d597-5c04-49b1-bb9f-f04cd527feee20180514.png\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/17f0f52c-748b-44e5-9659-17d88bc74c6020180514.png\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/14ca16fe-94e0-4050-aef2-2d0184c0127120180514.png\"/></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"font-family: 宋体; font-size: 14px;\">绽妍展位人员火爆</span></p><p><span style=\"font-family: 宋体; font-size: 14px;\"><br/></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/2b9054a7-f8a8-4eb7-8081-17f36cca07bc20180514.png\" title=\"\" alt=\"\"/></p><p><br/></p><p><span style=\";font-family:&#39;Times New Roman&#39;;font-size:14px\">15<span style=\"font-family:宋体\">日下午</span><span style=\"font-family:Times New Roman\">15</span><span style=\"font-family:宋体\">点，绽妍在一楼国际宴会厅特别设置了绽妍专场卫星会，会议由中国医科大学院皮肤病医院孙建方教授为大家带来了精彩的绽妍</span><span style=\"font-family:Times New Roman\">®</span><span style=\"font-family:宋体\">皮肤修护敷料与皮肤屏障受损专场演讲，分享了绽妍全系列产品的临床应用研究。</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/a50a7f7f-ec6e-40dd-bf06-bc47fff97ab920180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">中国医科大学院皮肤病医院孙建方教授讲解绽妍的临床应用</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/8fb0a3ec-1a02-4dda-a400-81f816e5df9120180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/47a17842-f28f-426f-a600-91c059d3327520180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">此次绽妍专场卫星会吸引了近</span>150<span style=\"font-family:宋体\">名医生到场听课，宽敞的会议室虚无坐席。绽妍为所有到场的医师准备了精美的礼品。最终会议在大家的掌声中圆满结束！</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/ff64909d-800d-4b4c-b2df-e5081715ab2b20180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">在广西皮肤科年会召开的同时，绽妍也在全国各地参与学术会议！</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: Calibri;font-size: 16px\"><span style=\"font-family:宋体\">绽妍</span>—<span style=\"font-family:宋体\">沈阳站</span></span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp; 2017<span style=\"font-family:宋体\">沈阳（亚洲）美容整形峰会</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/6b73b577-a476-4610-b6e0-4294652966a020180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/651f6ada-5fa4-4a30-8361-49248421d2fd20180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: Calibri;font-size: 16px\"><span style=\"font-family:宋体\">绽妍</span>—<span style=\"font-family:宋体\">哈尔滨站</span></span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">2017<span style=\"font-family:宋体\">中华中医学会皮肤科分会</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">基层大讲坛</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">活动</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/3b06da82-3961-4ad1-8599-896b33451f4120180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: Calibri;font-size: 16px\"><span style=\"font-family:宋体\">绽妍</span>—<span style=\"font-family:宋体\">商丘站</span></span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">2017<span style=\"font-family:宋体\">商丘市皮肤医学学术交流研讨会</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/fd732ed8-bf0e-41e0-9d1d-bcef3e4bf48020180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/fcd11b41-65c1-4768-a300-ecc6cfb2cc8320180514.png\" title=\"\" alt=\"\"/></p><p><span style=\";font-family:&#39;Times New Roman&#39;;font-size:14px\"><span style=\"font-family:宋体\">历经数年，绽妍始终秉持自己的初衷，为人类的美丽事业不断在努力，灿烂</span>7<span style=\"font-family:宋体\">月，绽妍一直在路上！</span></span></p><p><br/></p>', '1', '0', '0', '2018-05-14 15:32:38', '5ab4bbedff2c11e7a1a00a0027000004', '2018-05-14 15:32:49', '5ab4bbedff2c11e7a1a00a0027000004', null, null);
INSERT INTO `md_tweets_article` VALUES ('fc87df1b574c11e8ada17cd30ae458a2', '紫亚兰博览会-绽妍新品引领医学美白抗衰新风尚', 'http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/public/a2cd42c3-a3c1-4631-bef1-8197f27f11c120180514.png', '热搜', '5ab4bbedff2c11e7a1a00a0027000004', '0', '0', '4', '<p><span style=\";font-family:宋体;font-size:16px\">2017收官盛宴 丨紫亚兰博览会，绽妍新品引领医学美白抗衰新风尚</span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/24e05fb7-64ca-47a4-a723-4601107e243e20180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/78a8bee3-f56a-4fe8-98b0-75b5f9c4d66020180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: &#39;Times New Roman&#39;\"><span style=\"font-family:宋体\">紫亚兰国际医学美容暨抗衰老博览会</span></span></strong><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">于</span>12<span style=\"font-family:宋体\">月</span><span style=\"font-family:Calibri\">17</span><span style=\"font-family:宋体\">日在深圳会展中心圆满闭幕。绽妍受大会盛邀参与了此次为期三天（</span><span style=\"font-family:Calibri\">12.15~12.17</span><span style=\"font-family:宋体\">）的医美盛会，被大会授予</span></span><strong><span style=\"font-family: &#39;Times New Roman&#39;\">2017<span style=\"font-family:宋体\">中国整形美容行业组织贡献奖，</span></span></strong><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">并向广大参会者展示了三套全新系列产品：</span></span><strong><span style=\"font-family: &#39;Times New Roman&#39;;color: rgb(62, 62, 62)\"><span style=\"font-family:宋体\">绽妍</span>®<span style=\"font-family:宋体\">活肤亮颜系列</span></span></strong><span style=\";font-family:Calibri;font-size:16px\">&amp;</span><strong><span style=\"font-family: &#39;Times New Roman&#39;;color: rgb(62, 62, 62)\"><span style=\"font-family:宋体\">绽妍</span>®<span style=\"font-family:宋体\">紧致舒颜系列</span><span style=\"font-family:Times New Roman\">&amp;</span><span style=\"font-family:宋体\">绽妍</span><span style=\"font-family:Times New Roman\">®</span><span style=\"font-family:宋体\">果酸活肤系列</span></span></strong><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">，获得专家及参会者的一致关注、好评。</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\"><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/829a38c1-a200-4904-aa0f-ec5d96ce1b2620180514.png\" title=\"\" alt=\"\"/></span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/2efaa797-45d7-4721-8cce-0ebea0e248e020180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: &#39;Times New Roman&#39;\"><span style=\"font-family:宋体\">会议风采</span></span></strong></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/f4952b73-b45f-443d-a994-2fb232b650e920180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">会议支持</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">本次愽览会由中国整形美容协会主办，深圳市罗湖区人民政府、深圳市卫生和计划生育委员会支持、深圳市整形美容行业协会、紫亚兰国际会展（深圳）有限公司、深圳阳光医院投资集团等联合承办，中国整形美容协会抗衰老分会、中国整形美容协会护理分会、国家兰科中心协办。</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/e9172470-6561-4be0-bf52-1c3eab564bb820180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">会议阵容</span></span></p><p><span style=\";font-family:Calibri;font-size:14px\"><span style=\"font-family:宋体\">本届博览会秉承</span>“<span style=\"font-family:宋体\">汇聚世界医美力量、助力中国美丽梦想</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">的使命，完美呈现五大主题版块（</span><span style=\"font-family:Calibri\">23</span><span style=\"font-family:宋体\">场医美抗衰老高峰论坛、国际医美领袖圆桌会议、千人慈善舞会、医美抗衰老产业精品展），</span><span style=\"font-family:Calibri\">17</span><span style=\"font-family:宋体\">场专业学术高峰论坛，</span><span style=\"font-family:Calibri\">6</span><span style=\"font-family:宋体\">场运营管理高峰论坛，</span><span style=\"font-family:Calibri\">100</span><span style=\"font-family:宋体\">多位中外医美抗衰老行业领袖，</span><span style=\"font-family:Calibri\">400</span><span style=\"font-family:宋体\">余位国内外医美和抗衰老领域专家学者，百余家行业媒体共同聚集，构成了中国有史以来学术性专业性强、国际参与度高的</span><span style=\"font-family:Calibri\">2017</span><span style=\"font-family:宋体\">紫亚兰国际医学美容暨抗衰老博览会，给数千位海内外专家及与会嘉宾带来了一幕精彩的开篇巨献。</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/4f31caa9-b511-4866-bda3-f4ddd6ed9c6920180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">参会专家</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">博览会开幕式由著名外科整形专家赵启明教授主持，出席开幕式的嘉宾包括原全国人大教科文卫委员会副主任委员朱万勇主任，深圳市吴以环副市长，中国工程院付小兵院士、李兰娟院士，中国整形美容协会张斌会长，深圳市卫生和计划生育委员会罗乐宣主任，深圳市罗湖区王守睿常务副区长，亚洲和欧美</span>20<span style=\"font-family:宋体\">余个国家的抗衰老与整形外科协会、学会的会长、秘书长等。</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/8cbe3a16-d8cf-484b-b59a-fce23b5dd91820180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">绽妍盛景</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">“<span style=\"font-family:宋体\">再生医学科技，解决问题肌肤</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">，基于这</span></span><span style=\";font-family:Calibri;letter-spacing:0;font-size:16px\"><span style=\"font-family:宋体\">样的品牌定位，绽妍此次展出的产品除针对屏障修护的基础械品系列、针对敏感肌肤的舒缓修红系列、针对痤疮油性肌肤的控油清痘系列，还在会上首次展出即将上市三套新品：针对肤色暗沉的活肤亮颜系列、针对肌肤松弛的紧致舒颜系列、针对剥脱焕肤术的果酸活肤系列，丰富的产品线，业内独有。前来展位咨询的专家和参会者络绎不绝，绽妍赠送的样品成了会场最炙手可热的礼品。</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/90e2bd0d-4321-4bad-81fc-cc54db0cac4920180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/9330f32c-b048-4338-b110-40e211449ecd20180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/da16755e-dca0-4966-bcc2-258911a3462e20180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/452d9950-c825-4a5b-90bf-91d4062571dc20180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">2017<span style=\"font-family:宋体\">精彩瞬间</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">在即将过去的</span>2017<span style=\"font-family:宋体\">年，绽妍</span><span style=\"font-family:Calibri\">®</span><span style=\"font-family:宋体\">积极参与全国性学术会议、高峰论坛会议共七场，在每次会议中都受到专家及与会者的高度关注和肯定。</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">2107<span style=\"font-family:宋体\">绽妍参会风采</span></span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/b522749b-e481-4139-bf45-cece1119266120180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: &#39;Times New Roman&#39;\"><span style=\"font-family:宋体\">第十四次医学美容学术大会</span></span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">上海</span> 05.04</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 ;text-align:center\"><strong><span style=\"font-family: &#39;Times New Roman&#39;\"><span style=\"font-family:宋体\">第二十三次全国皮肤性病学术年会</span></span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 ;text-align:center\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">重庆</span> 05.11</span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/bcdc86ec-45c2-47ee-aea6-dccbda14f65020180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/0b7d4658-df4b-42b3-9ab2-b7602a99d0ee20180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 ;text-align:center\"><strong><span style=\"font-family: &#39;Times New Roman&#39;\"><span style=\"font-family:宋体\">全国激光美容与面部年轻化暨微创抗衰老学术大会</span></span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 ;text-align:center\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">昆明</span> 06.30</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: &#39;Times New Roman&#39;\"><span style=\"font-family:宋体\">亚洲美容整形峰会</span></span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">沈阳</span> 07.14</span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/49277568-ea35-4c89-934f-774da8898f2520180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/242e3055-c774-433c-a06c-1c3d89aef7ca20180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: &#39;Times New Roman&#39;\"><span style=\"font-family:宋体\">中华医学会激光美容高峰论坛</span></span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">新疆</span> 09.11</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 ;text-align:center\"><strong><span style=\"font-family: &#39;Times New Roman&#39;\"><span style=\"font-family:宋体\">第十三届中国皮肤科医师年会暨全国美容皮肤科学大会</span></span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 ;text-align:center\"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">苏州</span> 11.02</span></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/c4d8a1ef-d5a5-475b-b631-c3b7806daff320180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/d83e1a2d-2bf0-4a6a-a8d4-8b777526906220180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: &#39;Times New Roman&#39;\"><span style=\"font-family:宋体\">紫亚兰国际医学美容暨抗衰老博览会</span></span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">深圳</span> 12.15</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: &#39;Times New Roman&#39;\"><span style=\"font-family:宋体\">新品上市</span> <span style=\"font-family:宋体\">敬请关注</span></span></strong></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/cb3ad424-0aa9-4dc3-bc13-a20519b8da0b20180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">活肤亮颜</span></span></p><p><span style=\";font-family:Calibri;font-size:14px\"><span style=\"font-family:宋体\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;紧致舒颜</span></span></p><p><br/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/1455668f-2c6d-43d5-9740-775be3377f7620180514.png\" title=\"\" alt=\"\"/></p><p><img src=\"http://shemei.oss-cn-hangzhou.aliyuncs.com/qjxk/image/uediter/fa28498b-5c3e-47d2-a353-8e6367fb271620180514.png\" title=\"\" alt=\"\"/></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\"><span style=\"font-family:宋体\">果酸活肤</span></span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><span style=\";font-family:Calibri;font-size:16px\">&nbsp;</span></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: &#39;Times New Roman&#39;\"><span style=\"font-family:宋体\">感谢</span>2017<span style=\"font-family:宋体\">，绽妍一路有你。</span></span></strong></p><p style=\"margin-top:0;margin-right:0;margin-bottom:0;margin-left:0;padding:0 0 0 0 \"><strong><span style=\"font-family: &#39;Times New Roman&#39;\"><span style=\"font-family:宋体\">期待</span>2018<span style=\"font-family:宋体\">，你我携手共进！</span></span></strong></p><p><br/></p>', '1', '0', '0', '2018-05-14 16:01:20', '5ab4bbedff2c11e7a1a00a0027000004', '2018-05-14 16:01:33', '5ab4bbedff2c11e7a1a00a0027000004', null, null);
