  `ORDER_ITEM_ID` varchar(32) DEFAULT NULL COMMENT '订单商品表的item主键',
  `REASON` varchar(32) DEFAULT NULL COMMENT '退款理由code',
  `RETURN_FEE` double(65,2) DEFAULT NULL COMMENT '退款金额',
  `STATUS` int(1) DEFAULT NULL COMMENT '退款状态:0-申请售后,1-取消售后,2-待买家发货,3-待商家收货,4-拒绝退货,5-售后已完成',
  `RETURN_IMG` varchar(1000) DEFAULT NULL COMMENT '买家上传图片',
  `COMMENT` varchar(1000) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '退款说明',
