  `EXPRESS_CODE` varchar(32) DEFAULT NULL COMMENT '物流公司code',
  `EXPRESS_NUMBER` varchar(32) DEFAULT NULL COMMENT '物流单号',
  `RETURN_CODE` varchar(32) NOT NULL COMMENT '售后code',
  PRIMARY KEY (`ID`),
  KEY `index_return_code` (`RETURN_CODE`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=83 DEFAULT CHARSET=utf8;

