  `pk_review_id` varchar(32) NOT NULL COMMENT '评论id',
  `parent_review_id` varchar(32) DEFAULT NULL COMMENT '父级id(如果父接id为null,为主评论。不为空时为回复对象的id)',
  `review_object_id` varchar(32) NOT NULL COMMENT '评论对象id（视频，商品...）',
  `content` varchar(255) NOT NULL COMMENT '评论内容',
  `stuff_id` varchar(32) NOT NULL COMMENT '评论者id(一般为会员表的id,也可能是管理员评论回复)',
  `praised_num` int(8) NOT NULL COMMENT '评论被点赞的次数',
  `replied_num` int(8) NOT NULL COMMENT '评论被回复的次数',
  `is_top` int(1) NOT NULL COMMENT '是否置顶评论，默认0为不置，1为置顶',
  `is_hot` int(1) NOT NULL COMMENT '是否为热评，默认0为不是，1为热评',
  `data_status` int(1) NOT NULL COMMENT '数据状态：0为前端评论待审核，处于未显示；1为审核通过，前端显示评论',
  `review_status` int(1) NOT NULL COMMENT '评论状态：-1为已删除，0为待审核，1审核通过，2为审核未通过',
  `create_time` datetime NOT NULL,
  `delete_user_id` varchar(32) DEFAULT NULL COMMENT '删除人的用户id',
  `delete_time` datetime DEFAULT NULL COMMENT '删除时间',
  `auditor_user_id` varchar(32) DEFAULT NULL COMMENT '审核用户id',
  `auditor_time` datetime DEFAULT NULL COMMENT '审核时间',
  `is_author` int(1) NOT NULL COMMENT '回复者身份：是0为普通回复，1为后台管理员回复',
  `memo` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`pk_review_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

