-- ----------------------------
-- Table structure for `md_user`
-- ----------------------------
DROP TABLE IF EXISTS `md_user`;
CREATE TABLE `md_user` (
  `user_id` varchar(32) NOT NULL COMMENT '用户ID',
  `parent_id` varchar(32) DEFAULT NULL COMMENT '上级用户ID',
  `mobile` varchar(20) DEFAULT NULL COMMENT '手机号码',
  `password` varchar(50) DEFAULT NULL COMMENT '密码',
  `recommend_code` varchar(100) DEFAULT NULL COMMENT '推荐码',
  `user_name` varchar(50) DEFAULT NULL COMMENT '用户名',
  `name` varchar(50) DEFAULT NULL COMMENT '姓名',
  `gender` int(1) DEFAULT NULL COMMENT '姓名 1-男，2-女',
  `tel_phone` varchar(20) DEFAULT NULL COMMENT '座机号码',
  `identify_type` varchar(40) DEFAULT NULL COMMENT '证件类型 1-身份证,2-护照',
  `license_img_url` varchar(255) DEFAULT NULL COMMENT '代理商营业执照',
  `identify_no` varchar(40) DEFAULT NULL COMMENT '证件号码',
  `nick_name` varchar(255) DEFAULT NULL COMMENT '昵称',
  `user_type` int(1) DEFAULT NULL COMMENT '用户类型(1-医生，2-患者，3-代理商,4-销售，5-后端用户)',
  `status` int(1) DEFAULT NULL COMMENT '用户状态(0-作废,1-已审核,2-未提交,3-待审核,，4-审核不通过)                                                                                                                                              已审核,2-未提交,3-待审核,，4-审核不通过)',
  `img_url` varchar(255) DEFAULT NULL COMMENT '头像',
  `identify_img_url` varchar(255) DEFAULT NULL COMMENT '证件照片',
  `staff_img_url` varchar(255) DEFAULT NULL COMMENT '工作照',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `last_login_time` datetime DEFAULT NULL COMMENT '上次登录时间',
  `create_time` datetime DEFAULT NULL,
  `create_user_id` varchar(32) DEFAULT NULL,
  `last_modify_time` datetime DEFAULT NULL,
  `last_modify_user_id` varchar(32) DEFAULT NULL,
  `audit_time` datetime DEFAULT NULL COMMENT '审核时间',
  `audit_user_id` varchar(32) DEFAULT NULL COMMENT '审核人',
  `memo` varchar(255) DEFAULT NULL COMMENT '备注',
  `third_part_qq` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT 'qq登录',
  `third_part_weixin` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '微信登录',
  `client_id` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '登录手机地址',
  `platform_type` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '登录手机类型： 1 安卓 ；2 IOS',
  `channel_id` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '推送消息Id',
  `easemob_uid` varchar(4000) CHARACTER SET utf8 DEFAULT NULL COMMENT '环信uuid',
  `area_id` int(11) DEFAULT NULL COMMENT '区域_id',
  `city_id` int(11) DEFAULT NULL COMMENT '市_id',
  `province_id` int(11) DEFAULT NULL COMMENT '省_id',
  `qr_code` varchar(255) DEFAULT NULL COMMENT '二维码',
  `agent_level` int(1) DEFAULT NULL COMMENT '代理级别（1-省代，2-市代，3-区代）',
  `office_area_id` int(11) DEFAULT NULL COMMENT '办公区域id',
  `office_city_id` int(11) DEFAULT NULL COMMENT '办公市级id',
  `office_province_id` int(11) DEFAULT NULL COMMENT '办公省级ID',
  PRIMARY KEY (`user_id`),
  KEY `mobile_index` (`mobile`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

