-- ----------------------------
-- View structure for `md_v_tweet_comment_user`
-- ----------------------------
DROP VIEW IF EXISTS `md_v_tweet_comment_user`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `md_v_tweet_comment_user` AS select `md_doctor_user`.`d_user_id` AS `id`,`md_doctor_user`.`name` AS `name`,`md_doctor_user`.`img_url` AS `img_url`,`md_doctor_user`.`title` AS `comment`,`md_doctor_user`.`mobile` AS `mobile`,1 AS `type` from `md_doctor_user` where (`md_doctor_user`.`status` = 1) union select `md_patient_user`.`p_user_id` AS `id`,`md_patient_user`.`nick_name` AS `name`,`md_patient_user`.`img_url` AS `img_url`,'' AS `comment`,`md_patient_user`.`mobile` AS `mobile`,0 AS `type` from `md_patient_user` where (`md_patient_user`.`status` = 1) union select `md_user`.`user_id` AS `id`,`md_user`.`nick_name` AS `name`,`md_user`.`img_url` AS `img_url`,'' AS `comment`,`md_user`.`mobile` AS `mobile`,2 AS `type` from `md_user` where ((`md_user`.`status` = 1) and (`md_user`.`user_type` in (3,4)));

-- ----------------------------
-- View structure for `md_v_user`
-- ----------------------------
DROP VIEW IF EXISTS `md_v_user`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `md_v_user` AS select `md_doctor_user`.`d_user_id` AS `user_id`,(case when isnull(`md_doctor_user`.`nick_name`) then `md_doctor_user`.`name` else `md_doctor_user`.`nick_name` end) AS `name`,`md_doctor_user`.`img_url` AS `img_url`,`md_doctor_user`.`title` AS `comment`,`md_doctor_user`.`mobile` AS `mobile`,1 AS `user_type` from `md_doctor_user` where (`md_doctor_user`.`status` <> 0) union select `md_patient_user`.`p_user_id` AS `user_id`,`md_patient_user`.`nick_name` AS `name`,`md_patient_user`.`img_url` AS `img_url`,'' AS `comment`,`md_patient_user`.`mobile` AS `mobile`,2 AS `user_type` from `md_patient_user` where (`md_patient_user`.`status` <> 0) union select `md_user`.`user_id` AS `user_id`,`md_user`.`nick_name` AS `name`,`md_user`.`img_url` AS `img_url`,'' AS `comment`,`md_user`.`mobile` AS `mobile`,`md_user`.`user_type` AS `user_type` from `md_user` where ((`md_user`.`status` <> 0) and (`md_user`.`user_type` in (3,4,5)));

-- ----------------------------
-- Procedure structure for `CHECK_UNIQUENESS_TABLE_FILED`
-- ----------------------------
DROP PROCEDURE IF EXISTS `CHECK_UNIQUENESS_TABLE_FILED`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `CHECK_UNIQUENESS_TABLE_FILED`(I_TABLE_NAME VARCHAR(500),I_TABLE_FILED_STR VARCHAR(4000),I_TABLE_VAL_STR VARCHAR(4000),
	I_ID_WHERE VARCHAR(4000), OUT O_CODE VARCHAR(10), OUT O_MSG VARCHAR(500))
BEGIN
	DECLARE V_COUNT           INT(8) DEFAULT 0;
    DECLARE V_SQL_STR         VARCHAR(4000) DEFAULT CONCAT('SELECT COUNT(*) INTO @V_COUNT FROM ' , I_TABLE_NAME);
    DECLARE V_FILED_SIZE      INT(8) DEFAULT 0;
    DECLARE V_TABLE_FILED_STR VARCHAR(4000) DEFAULT I_TABLE_FILED_STR;
    DECLARE V_TABLE_VAL_STR   VARCHAR(4000) DEFAULT I_TABLE_VAL_STR;
    DECLARE V_FILED_STR       VARCHAR(4000) DEFAULT '';
    DECLARE V_VAL_STR         VARCHAR(4000) DEFAULT '';
    DECLARE V_S               INT(8) DEFAULT 0;
   /* DECLARE EXIT HANDLER FOR SQLEXCEPTION BEGIN SET O_CODE = '-1';
    SET O_MSG = '发生异常'; END;*/
    
    SELECT (LENGTH(V_TABLE_FILED_STR) -
           LENGTH(REPLACE(V_TABLE_FILED_STR, ';', ''))) + 1
      INTO V_FILED_SIZE
      FROM DUAL;
  
    SET O_CODE = '0';
    SET O_MSG  = '';
    
    -- 循环结束标志
    OUTER_LABEL:BEGIN
    
    WHILE V_S < V_FILED_SIZE DO
      IF INSTR(V_TABLE_FILED_STR, ';') = 0 THEN
        SET V_FILED_STR = V_TABLE_FILED_STR;
      ELSE
        SET V_FILED_STR       = SUBSTR(V_TABLE_FILED_STR,
                                    1,
                                    INSTR(V_TABLE_FILED_STR, ';') - 1);
        SET V_TABLE_FILED_STR = SUBSTR(V_TABLE_FILED_STR,
                                    INSTR(V_TABLE_FILED_STR, ';') + 1);
      END IF;
      IF INSTR(V_TABLE_VAL_STR, ';') = 0 THEN
        SET V_VAL_STR = V_TABLE_VAL_STR;
      ELSE
        SET V_VAL_STR       = SUBSTR(V_TABLE_VAL_STR,
                                  1,
                                  INSTR(V_TABLE_VAL_STR, ';') - 1);
        SET V_TABLE_VAL_STR = SUBSTR(V_TABLE_VAL_STR,
                                  INSTR(V_TABLE_VAL_STR, ';') + 1);
      END IF;
      
      -- 拼接sql
      IF I_ID_WHERE IS NULL THEN
		SET I_ID_WHERE = '';
      END IF;
      SET @SQLSTR = CONCAT(V_SQL_STR,' WHERE (' , V_FILED_STR , ') IN ((', V_VAL_STR ,'))' , I_ID_WHERE);
      
      -- 写日志
      -- CALL INSERT_SQL_LOG(@SQLSTR);
      
      PREPARE STMT FROM @SQLSTR;
      EXECUTE  STMT;
      
	  SET V_COUNT = @V_COUNT;
      -- 写日志
	  -- CALL INSERT_SQL_LOG(V_COUNT);
      
	  DEALLOCATE PREPARE STMT;
      
      IF V_COUNT >= 1 THEN
        SET O_CODE = '-1';
        SET O_MSG  = CONCAT(V_FILED_STR , '已有记录');
        LEAVE OUTER_LABEL;
      END IF;
      SET V_S = V_S + 1;
    END WHILE;
    
    END OUTER_LABEL;
    
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `sales_statistics`
-- ----------------------------
DROP PROCEDURE IF EXISTS `sales_statistics`;
DELIMITER ;;
CREATE DEFINER=`shengem8db`@`%` PROCEDURE `sales_statistics`(
	IN startDate VARCHAR(50),
	IN endDate VARCHAR(50),
	OUT browseNum INT, #访问人数
	OUT buyerNum INT, #支付人数
	OUT transferRate DECIMAL, #支付转化率
	OUT payOrderNum INT, #支付订单数
	OUT sellToalPrice DECIMAL, #支付总价格
	OUT returnOrderNum INT, #退单订单数
	OUT returnOrderPrice DECIMAL, #退单总价格
	OUT completeOrderNum INT,#完成订单数（客户收货为计算依据）
	OUT salesProductNum INT#销售总商品数（订单完成状态的商品）
)
BEGIN
SELECT count(1) INTO browseNum  FROM md_product_view pv WHERE pv.view_time BETWEEN startDate AND endDate; #计算访问人数
SELECT count(1) INTO buyerNum FROM md_order o where o.create_time BETWEEN startDate AND endDate; #计算支付人数
SELECT SUM(o.order_amount) INTO sellToalPrice FROM md_order o WHERE o.create_time BETWEEN startDate AND endDate; #计算支付总价格
SET transferRate = buyerNum/browseNum*100; #计算支付转化率
SET payOrderNum = buyerNum; #计算支付订单数
SELECT count(1),sum(ore.return_fee) INTO returnOrderNum ,returnOrderPrice FROM md_order_return ore where ore.status =5 and ore.CREATE_TIME BETWEEN startDate AND endDate;
SELECT count(1) INTO completeOrderNum FROM md_order o where o.order_status in(4,6) AND o.create_time BETWEEN startDate AND endDate;# 待评价，已完成
SELECT sum(oi.product_num) INTO salesProductNum from md_order_item oi INNER JOIN md_order o ON o.order_id=oi.order_id where o.order_status in (4,6) AND o.create_time BETWEEN startDate AND endDate;

END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `getChildLst`
-- ----------------------------
DROP FUNCTION IF EXISTS `getChildLst`;
DELIMITER ;;
CREATE DEFINER=`shengem8db`@`%` FUNCTION `getChildLst`(rootId VARCHAR(32)) RETURNS varchar(4000) CHARSET utf8mb4
BEGIN
DECLARE sTemp VARCHAR(4000);
DECLARE sTempChd VARCHAR(4000);
 
SET sTemp = '$';
SET sTempChd = cast(rootId  as char);
 
WHILE sTempChd is not NULL DO
SET sTemp = CONCAT(sTemp,',',sTempChd);
SELECT 
    GROUP_CONCAT(comment_id)
INTO sTempChd FROM
    md_tweets_comment
WHERE
    FIND_IN_SET(comment_original_comment_id, sTempChd)>0;
END WHILE;
return REPLACE(sTemp,rootId,'') ;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `NUMBER_FORMAT_FUN`
-- ----------------------------
DROP FUNCTION IF EXISTS `NUMBER_FORMAT_FUN`;
DELIMITER ;;
CREATE DEFINER=`shengem8db`@`%` FUNCTION `NUMBER_FORMAT_FUN`(I_VALUE   DECIMAL(20,6),
                                 I_SCALE         INT(2)) RETURNS varchar(100) CHARSET utf8
    COMMENT '数字格式化'
BEGIN 
    DECLARE V_NUM VARCHAR(100) DEFAULT '';
	DECLARE O_NUM_VAL VARCHAR(100); 
	SET O_NUM_VAL = CAST(ROUND(I_VALUE,I_SCALE) AS CHAR);
    OUTER_LABEL:BEGIN
	WHILE O_NUM_VAL IS NOT NULL AND INSTR(O_NUM_VAL,'.') >= 1 DO
		-- 剪切字符串
		SET V_NUM = RIGHT(O_NUM_VAL,1);
		IF V_NUM = '0' OR V_NUM = '.' THEN
			SET O_NUM_VAL = LEFT(O_NUM_VAL , LENGTH(O_NUM_VAL) - 1);
		ELSE
			LEAVE OUTER_LABEL;
		END IF;
	END WHILE;
    END OUTER_LABEL;
    RETURN O_NUM_VAL;
END
;;
DELIMITER ;
